// Layout.jsx
import React from "react";
import Header from "./Header";
import { Outlet } from "react-router-dom";
import { FaUser, FaLock, FaPlus } from "react-icons/fa";

const Layout = () => {
  return (
    <>
      <Header />
      <main>
        <Outlet />
      </main>
    </>
  );
};

export default Layout;
